import React from "react";
import Slide from "../menu/Slide";
import Bestseller from "../Slider/Bestseller";
import AboutUs from "../menu/AboutUs";
import Navbars from "../Slider/NavBar";
import Footer from "../menu/Footer";
import PathFrame from "../menu/PathFrame";
import PodCast from "../Slider/PodCast";
import styled from "styled-components";
const Home = () => {
  return (
    <HomeDiv>
      <div className="row">
        <Navbars />
        <Slide />
        <PathFrame />
        <Bestseller />
        <PodCast />
        <AboutUs />
        <Footer />
      </div>
    </HomeDiv>
  );
};
const HomeDiv = styled.div`
  @media (max-width: 767px) {
    width: 100%;
  }
`;
export default Home;
